          </Typography>
        </Box>
      </Box>


      {/* Audio Player Section */}
      <Box sx={{ py: 10, backgroundColor: '#ffffff' }}>
        <Container maxWidth="lg">
          <Typography
            variant="h3"
            sx={{
              textAlign: 'center',
              mb: 6,
              fontWeight: 'bold',
              color: '#000000'
            }}
          >
            Demo Mixuri
          </Typography>

          <Box sx={{ mb: 4 }}>
            <AudioPlayer
              playList={mixData}
              audioInitialState={{
                isPlaying: false,
                volume: 0.5
              }}
              placement={{
                interface: {
                  templateArea: {
                    trackTimeCurrent: 'row1-5',
                    trackTimeDuration: 'row1-6',
                    progress: 'row1-7',
                    playButton: 'row2-1',
                    repeatType: 'row2-2',
                    volume: 'row2-3',
                    playList: 'row2-4'
                  }
                }
              }}
              activeUI={{
                all: true,
                playButton: true,
                prevNnext: true,
                volume: true,
                volumeSlider: true,
                repeatType: true,
                trackTime: true,
                trackInfo: true,
                playList: true,
                progress: 'waveform'
              }}
            />
          </Box>

          <Typography
            variant="body1"
            sx={{
              textAlign: 'center',
              color: '#666666',
              fontSize: '1.1rem',
              lineHeight: 1.6
            }}
          >
            Acestea sunt doar cÃ¢teva exemple din repertoriul meu. Pentru fiecare eveniment,
            creez un playlist personalizat Ã®n funcÈ›ie de preferinÈ›ele dumneavoastrÄƒ È™i atmosfera doritÄƒ.
          </Typography>
        </Container>
      </Box>
    </>
  );
};

export default Mixes;
